import styled from "styled-components";

export const LeaderBoardDiv = styled.div`
  background-color: #262421;
  height: 80vh;
  overflow: scroll;
  color: #E0E0E0;
  padding: 30px; 
  border-radius: 2%;
`;

export const LeaderBoardTitle = styled.div`
  margin-bottom: 30px;
  font-size: 22px;
`;
